import React, { Component } from "react";

class Car extends Component {
  constructor() {
    super();
    this.bike = { brand: "BMW" };
  }
  render() {
    return (
      <>
        <h1>This is car page</h1>
        <h2>The car brand is {this.bike.brand}</h2>
      </>
    );
  }
}

export default Car;
